import React from 'react';

const containerStyle = {
  display: 'flex',
  flexDirection: 'column',
  height: '100vh',
};

const headerStyle = {
  marginTop: 50,
  fontSize: 30,
  marginBottom: 50,
  textAlign: 'center',
};

const paragraphStyle = {
  fontSize: 20,
  marginLeft: 20,
}

const stepHeaderStyle = {
  fontSize: 30,
  fontWeight: 'bold',
  marginLeft: 20,
  marginTop: 20,
  marginBottom: 20,
}

export default class GoogleCalendarInstructions extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {

    return (
    <div style={containerStyle}>
      <div style={headerStyle}>
        Import events to Google Calendar
      </div>
      <div style={paragraphStyle}>
      You can transfer your events from a different calendar application or Google Account to Google Calendar.
      </div>
      <div style={stepHeaderStyle}>
      Step 1: Open Google Calendar
      </div>
      <div style={paragraphStyle}>
      Navigate to https://calendar.google.com
      </div>
    </div>
    );
  }
}
